import React from 'react'
import cl from './InputTogle.module.css'

const InputTogle = () => {
  return (
    <div className={`${cl.button} ${cl.r}`} id={cl['button-1']}>
      <input type="checkbox" className={cl.checkbox} />
      <div className={cl.knobs}></div>
      <div className={cl.layer}></div>
    </div>
  )
}

export default InputTogle
